import '../styles/style.css';
import {useState} from "react";

const Form = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');

    const handleFirstName = (e) => {
        setFirstName(e.target.value);
    }

    const handleLastName = (e) => {
        setLastName(e.target.value);
    }

    return (
        <div className='form-container'>
            <form className='form'>
                <label>First name: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>Last name: </label>
                <input value={lastName} type={"text"} onChange={handleLastName}/>
                <label>Address: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>Zip code: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>City: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>Phone number: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>Email address: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>Spring cleaning: </label>
                <input value={firstName} type={"radio"} onChange={handleFirstName}/>
                <label>Fall cleaning: </label>
                <input value={firstName} type={"radio"} onChange={handleFirstName}/>
            </form>
        </div>
    );
}

export default Form;
